import React, { useEffect, useState, lazy } from 'react';
import { Link, Route, Switch, useLocation } from 'react-router-dom';
import { Row, Col, Layout, Tabs } from 'antd';
import './Rules.css';
function Rules() {

    const { TabPane } = Tabs;

    const Rules = () => {
        return (
            <>
                <div className="rules-container">
                    <div className="rules-content">
                        <Tabs defaultActiveKey="1" >
                            <TabPane tab="Điều khoản dịch vụ" key="1">
                                <div className="footer-content">
                                    <h4>1. Dịch vụ chúng tôi cung cấp</h4>
                                    <span>Mang lại trải nghiệm dành riêng cho bạn</span>
                                </div>
                            </TabPane>
                            <TabPane tab="Chính sách dữ liệu" key="2">
                                Content of Tab Pane 2
                            </TabPane>
                            <TabPane tab="Tiêu chuẩn cộng đồng" key="3">
                                Content of Tab Pane 3
                            </TabPane>
                        </Tabs>
                    </div>
                </div>
            </>
        )
    }

    return (
        <Switch>
            <Route component={Rules} />
        </Switch>
    )



}

export default Rules;
